    @Test
    void testParsingDataToObjectSuccess() throws DataProcessingConsumerException, JAXBException, DataProcessingException {
        Gson gson = new Gson();
        NbsInterfaceModel nbsInterfaceModel = null;
        nbsInterfaceModel = gson.fromJson(getData(), NbsInterfaceModel.class);
        utility = new DataExtractionServiceUtility();
        dataExtractionService = new DataExtractionService(hl7PatientHandler, observationRequestHandler, observationResultRequestHandler, msgOutEStoredProcService, orcHandler, utility, labResultUtil, nbsInterfaceStoredProcRepository);


        EdxLabInformationDto edxLabInformationDto = new EdxLabInformationDto();
        edxLabInformationDto.setStatus(NbsInterfaceStatus.Success);
        edxLabInformationDto.setNbsInterfaceUid(nbsInterfaceModel.getNbsInterfaceUid());

        when(labResultUtil.getLabResultMessage(any(HL7MSHType.class), eq(edxLabInformationDto))).thenReturn(labResultMessage());

        when(hl7PatientHandler.getPatientAndNextOfKin(any(HL7PATIENTRESULTType.class), any(LabResultProxyContainer.class), eq(edxLabInformationDto))).thenReturn(labResultMessage());

        LabResultProxyContainer result = dataExtractionService.parsingDataToObject(nbsInterfaceModel, edxLabInformationDto);
        assertNotNull(result);
    }

